import React from 'react';
import { useLocation } from 'react-router-dom';

const QuizResultPage = () => {
  const location = useLocation();
  const { score } = location.state || {};

  console.log('Session at result page:', sessionStorage.getItem('userSession'));  // Assuming session info is stored in sessionStorage

 // if (score === undefined) {
 //   return <div>Error: Score not found. Please make sure you've completed the quiz.</div>;
 // }

  return (
<div>
      <h1>Quiz Results</h1>
      <div>
        {score !== undefined ? (
          <div>
            <h2>Your Final Score: {score}</h2>
          </div>
        ) : (
          <div>No score available. Please complete the quiz.</div>
        )}
      </div>
    </div>
  );
};

export default QuizResultPage;
